import React from 'react';
import Image from 'next/image'

export default function Index() {
  return (
    <React.Fragment>
      <Image
        src="/bbhaus.jpg"
        alt="Picture of the author"
        width={500}
        height={500}
      />
    </React.Fragment>
  );
}
